import React, {Component} from 'react'

const SearchBar = () => {
    return(
        <form className = "search" /* onSubmit = {this.handleSubmit} */ className = "search-bar">
            <input
                type = "text"
                name = "search"
                value = {this.state.search}
                placeholder = "Look for"
                onChange = {this.handleChange}/>
        </form>
    )
}

export default SearchBar
